INSERT INTO `governance_metric` VALUES (1,'是否有技术Owner','TEC_OWNER','辅助信息是否填写技术Owner 有 则10分 ， 无则0分','SPEC',NULL,'/table_meta/table_meta/detail?tableId={tableId}',NULL,'0'),(2,'是否有业务Owner','BUSI_OWNER','辅助信息是否填写业务Owner 有 则10分 ， 无则0分','SPEC',NULL,'/table_meta/table_meta/detail?tableId={tableId}',NULL,'0'),(3,'是否长期无产出','NO_PRODUCE','一张表{days}天内没有产出数据  则给0分，其余给10','CALC','{\"days\":7}',NULL,NULL,'0'),(4,'表是否有备注','TABLE_HAS_COMMENT','表是否有备注，有 则10分 ， 无则0分','SPEC',NULL,NULL,NULL,'0'),(5,'字段是否有备注信息','TABLE_FIELDS_HAVE_COMMENT','字段是否有备注信息，有备注字段/所有字段 *10分','CALC',NULL,NULL,NULL,'0'),(6,'是否空表','TABLE_IS_EMPTY','空表则0分 ，有数据则10分','SPEC',NULL,NULL,NULL,'0'),(7,'是否长期无访问','NO_ACCESS','一张表{days}天内没有访问 则给0分 ， 其余给10','CALC','{\"days\":3}',NULL,NULL,'0'),(8,'未明确安全等级','NO_SECURITY','未设置 0分  其余10分','SPEC',NULL,NULL,NULL,'0'),(9,'生命周期是否合理','REASONABLE_LIFECYCLE','未设定周期类型的 给 0分，周期类型为永久、拉链表 则给10分，周期类型为日分区 :无分区信息的给0分，没设生命周期给0分，周期长度超过建议周期天数{days}给5分 ','SPEC','{\"days\":5}',NULL,NULL,'0'),(10,'表名是否合规','TABLE_NAME_STANDARD','参考建数仓表规范，符合则 10分，否则0分，未纳入分层，给5分','SPEC',NULL,NULL,NULL,'0'),(11,'是否为相似表','TABLE_SIMILAR','同层次两个表字段重复超过{percent}%，则给0分，其余给10分','STORAGE','{\"percent\":80}',NULL,NULL,'0'),(12,'文件目录是否超过建议权限','FILE_ACCESS_PERMISSION','检查该表最高权限的目录或者文件，如果超过文件超过{file_permission}或者目录超过{dir_permission}则给0分 其余给10分','SECURITY','{\"file_permission\":\"644\",\"dir_permission\":\"755\"}',NULL,NULL,'0'),(13,'表产出数据量监控','MONITOR_TABLE_DATA_QUALITY','必须日分区表，当日产出的数据量，超过前x天平均产出量{upper_limit}% ，或低于{lower_limit}%  ，则给0分，其余10分','QUALITY','{\"upper_limit\":60,\"lower_limit\":30,\"x\":3}',NULL,NULL,'0'),(14,'任务是否有失败','TASK_FAIL','失败给0','CALC',NULL,NULL,NULL,'0'),(15,'表产出时效监控','TIME_LINESS','当日产出时效，超过前x天产出时效平均值n%,则给0分，其余10分','QUALITY','{\"days\":3,\"percent\":30}',NULL,NULL,'0'),(16,'是否简单加工','IS_SIMPLE_PROCESS','sql语句没有任何join\\groupby\\union\\函数的复杂计算， 且 where过滤字段皆为分区字段，则视为简单加工，给0分，其余给10分','CALC',NULL,NULL,NULL,'0'),(17,'是否数据倾斜','DATA_SKEW','检查是否有数据倾斜，如果某个stage的最大任务耗时超过平均耗时任务耗时的{percent}%, 只检查耗时超过{stage_dur_seconds}秒的stage。','CALC','{\"stage_dur_seconds\":5,\"percent\":200}',NULL,NULL,'0');
